      <p>I am just a guy. Specifically, I am a guy who graduated with a Bachelor of Science in Computer Engineering  
        <a href="https://classof2020.clemson.edu/#badge__canvas" title="this is technically XSS">(proof here)</a>.</p>

    </div>
  );
};
